1. 전체 시나리오 요약  
   GIF는 어두운 칠판 배경 위에 분필 느낌의 흰색 손글씨 “good!”이 차례로 나타나고, 그 주변을 다채로운 원·삼각형·사각형·지그재그 선들이 마치 축하용 ‘콘페티(confetti)’처럼 빠르게 흩어졌다 모였다 하며 반짝이는 애니메이션이다.  
   • T₁ (0–0.5초) : 칠판이 검은색으로 깔리다가 흰 분필 자국이 “g”→“go”→…→“good!” 순으로 그려짐  
   • T₂ (0.5–1.0초) : 문자 완성 직후부터 주변에 작은 도형들이 불규칙하게 나타나기 시작  
   • T₃ (1.0–1.5초) : 도형들 간헐적 깜빡임 및 크기·투명도 변화를 반복  
   • T₄ (1.5–2.0초) : 애니메이션 루프 전환을 위해 모든 도형이 사라지고 다시 T₁로 리셋  

2. 관여·등장 객체  
   2‑1. 개별 객체 목록  
   • explicit 오브젝트  
     - 중앙 텍스트: “good!” (흰색 분필)  
     - 배경 칠판 (검정)  
   • implicit 오브젝트  
     - 콘페티 패턴(여러 도형이 모여 마치 ‘축하 파티 분위기’를 형성)  
       {  
         참여객체: ["빨강 원","연두 삼각형","보라 사각형","파랑 지그재그","흰 선"]  
         참여방식: "불규칙 배치 및 깜빡임"  
         참여숫자: 약 80여 개  
         유사객체: ["파티용 색종이 조각","분필 낙서"]  
       }  

   2‑2. 프레임 내 객체 위치 매핑(30×30 격자 기준)  
   • 전체 GIF는 정사각(가로=세로)이므로 30×30 격자 사용  
   • “good!”  
     {  
       “good!”: [  
         [5,12],[6,12],[7,12],…,[24,18]   ← 글자 획이 지나가는 좌표 대략 35점  
       ]  
     }  
   • 원 (빨강)  
     {  
       “circle_red”: [ [3,4],[10,8],[25,5],…,[27,28] ]  ← 약 12개 좌표  
     }  
   • 삼각형 (연두)  
     {  
       “triangle_green”: [ [2,20],[8,25],[15,2],…,[28,15] ]  
     }  
   • 사각형 (보라)  
     {  
       “square_purple”: [ [6,6],[12,22],…,[24,24] ]  
     }  
   • 지그재그 선 (파랑)  
     {  
       “zigzag_blue”: [ [3,14],[9,17],…,[26,13] ]  
     }  
   • 직선 (흰)  
     {  
       “line_white”: [ [14,3],[16,5],…,[18,27] ]  
     }  

3. 프레임 간 객체 상호작용 개요  
   • T₁→T₂ : “good!” 글자 획 그려짐 (객체 생성)  
   • T₂→T₃ : 다색 도형들이 빠르게 흩어졌다 모였다(깜빡임)  
   • T₃→T₄ : 도형 투명도와 크기 미세 변형(확장·축소)  
   • T₄→T₁ : 모든 도형과 글자 사라짐(소멸) → 루프  

4. 상호작용 상세 항목  
   [  
     {  
       "관여하는 객체": ["good! 글자"],  
       "상호작용 종류": "획 그리기",  
       "상호작용의 파라미터": ["획 길이","획 속도"]  
     },  
     {  
       "관여하는 객체": ["circle_red","triangle_green","square_purple","zigzag_blue","line_white"],  
       "상호작용 종류": "반짝임(깜빡임)",  
       "상호작용의 파라미터": ["주기","투명도 진폭"]  
     },  
     {  
       "관여하는 객체": ["circle_red","triangle_green",…],  
       "상호작용 종류": "크기 변형(확장·축소)",  
       "상호작용의 파라미터": ["스케일 범위","시간"]  
     },  
     {  
       "관여하는 객체": ["전체 오브젝트"],  
       "상호작용 종류": "소멸 및 초기화",  
       "상호작용의 파라미터": ["딜레이","리셋 타이밍"]  
     }  
   ]  

5. 유추 가능한 유사 상황  
   • 교실 칠판 위에 선생님이 시험 답안을 채점하며 학생들을 응원하기 위해 “good!”이라고 쓰고 색종이 조각을 뿌린 듯한 파티 풍경  
   • 온라인 비디오 자막으로 “Well done!” 자막이 나타나고 뒤에서 Confetti가 터지는 연출

자 이제 마지막으로 각 문제별로 실수없이 너가 문제를 잘 만들어서 푸는사람이 혼선이 없게 '정답'이 있게끔 만들었는지
다시한번 검증해봐. 만약 실수한 부분이 있다면 즉시 정확하게 고쳐서 다시 줘야할꺼야.

**돌려줄 때는 역시 마찬가지로  아래 형식의 JSON로 반환해줘, 2차원 배열의 각 요소는 0~9 중 하나를 값으로 가져: **  
```json
{
    "task":[
        {"input": [...], "output": [...], "solution": "…"},
        {"input": [...], "output": [...], "solution": "…"}
    ]
}
```

좋아 이제 input을 바탕으로 Output을 만드는 소스코드를 짜서 code안에 넣어어 줘

```json
{
    "task":[
        {"input": [...], "output": [...], "code": "…"},
        {"input": [...], "output": [...], "code": "…"}
    ]
}
```
